import React from "react";
import {render} from "react-dom";
import {BrowserRouter, Route, Routes, Link} from "react-router-dom";
import Navbar from "./Navbar.js";
import Home from "./Home.js";
import About from "./About.js";
import Products from "./Products.js";
import Cart from "./Cart.js";

function App() {
  return (<><BrowserRouter>
    <Navbar />
    <Routes>
      <Route exact path="/"><div class="container"><Home/></div></Route>
      <Route exact path="/about"><div class="container"><About/></div></Route>
      <Route exact path="/products"><div class="container"><Products/></div></Route>
      <Route exact path="/cart"><div class="container"><Cart/></div></Route>
    </Routes>
  </BrowserRouter></>);
}

render(<App />, document.selectElementById("#root"));
